import React from 'react';
import { Tabs } from 'antd';
// import { AppstoreOutlined, AreaChartOutlined } from '@ant-design/icons';

const { TabPane } = Tabs;

const ComponentPanel: React.FC = () => {
  return (
    <Tabs defaultActiveKey="1">
      <TabPane 
        tab={
          <span>
            {/* <AppstoreOutlined /> */}
            基础组件
          </span>
        } 
        key="1"
      >
        <div className="component-item" draggable>
          按钮
        </div>
        <div className="component-item" draggable>
          输入框
        </div>
        {/* 更多组件项 */}
      </TabPane>
      <TabPane 
        tab={
          <span>
            {/* <AreaChartOutlined /> */}
            图表组件
          </span>
        } 
        key="2"
      >
        <div className="component-item" draggable>
          折线图
        </div>
        <div className="component-item" draggable>
          柱状图
        </div>
        {/* 更多图表组件 */}
      </TabPane>
    </Tabs>
  );
};

export default ComponentPanel;
